import React from "react";
import Footer from "../components/Footer";
import Navbar from "../components/Navbar";
import "./routesCss/Projects.css";

const Projects = (props) => {
	// console.log(props);
	return (
		<div className="projectsDiv">
			<Navbar />
			<div className="projects">
				{props.websites.websites.map((site) => {
					return (
						<div className="ProjectsContainer" key={site.id}>
							<div className={site.classname2}>
								<div className="siteImageDiv">
									<img className="siteImage" alt="" src={site.image} />
								</div>
							</div>
							<div className={site.classname}>
								<h1>{site.name}</h1>

								<div className="languagesDisplayedPtag">
									<p className="skill1">{site.languagesDisplayed[0]}</p>
									<p className="skill2">{site.languagesDisplayed[1]}</p>
									<p className="skill3">{site.languagesDisplayed[2]}</p>
									<p className="skill4">{site.languagesDisplayed[3]}</p>
									<p className="skill5">{site.languagesDisplayed[4]}</p>
									<p className="skill6">{site.languagesDisplayed[5]}</p>
								</div>
								<p>{site.Responsibilities}</p>
								<p className="description">{site.description}</p>
								<a className="siteLink" href={site.url}>
									View Site Here
								</a>
							</div>
						</div>
					);
				})}
			</div>
			<Footer />
		</div>
	);
};

export default Projects;
